import Motion from './core/index';
import Cpu from'./cpu/index';
import Speed from './speed/index';
import Tween from'./math/tween';

var MFrame = function(configs, events) {
    return new Motion(configs, events);
};

MFrame.Cpu = Cpu;
MFrame.Tween = Tween;
MFrame.speed = function(configs, events, x) {
    return new Speed(configs, events, x);
};

var registerWindow = function(name, func) {
    if (typeof window !== 'undefined' && window[name] === undefined) {
        window[name] = func;
    }
};

registerWindow('mf', MFrame);
registerWindow('mframe', MFrame);

export default MFrame;

import css from'./css';
import attr from'./attr';
import prop from'./prop';
import arg from'./arg';

var Cpu = {
    Cores: {
        css,
        attr,
        prop,
        arg
    },
    install: function (name, core) {
        this.Cores[name] = core;
    },
    uninstall: function (name) {
        delete this.Cores[name];
    },
    createStorage: function () {
        var storage = {};
        for( var name in this.Cores) {
            storage[name] = {};
        }
        return storage;
    },
    core: function (name) {
        return this.Cores[name];
    }
}

export default Cpu;

/*
    * Tween
    * @Author:     yulianghuang
    * @CreateDate  2020/2/7
    * @param t {num} current time（当前时间）
    * @param b {num} beginning value（初始值）
    * @param c {num} change in value（变化量）
    * @param d {num} duration（持续时间）
*/
var Tween = {
    // test
    add: function(name, func) {
        this[name] = func;
    },
    linear: function(t,b,c,d){
        return c*t/d + b;
    },
    easeIn: function(t,b,c,d){
        return c*(t/=d)*t + b;
    },
    easeOut: function(t,b,c,d){
        return -c *(t/=d)*(t-2) + b;
    },
    easeInOut: function(t,b,c,d){
        if ((t/=d/2) < 1) return c/2*t*t + b;
        return -c/2 * ((--t)*(t-2) - 1) + b;
    },  
    easeInCubic: function(t,b,c,d){
         return c*(t/=d)*t*t + b;
    },
    easeOutCubic: function(t,b,c,d){
        return c*((t=t/d-1)*t*t + 1) + b;
    },
    easeInOutCubic: function(t,b,c,d){
        if ((t/=d/2) < 1) return c/2*t*t*t + b;
        return c/2*((t-=2)*t*t + 2) + b;
    },
    easeInQuart: function(t,b,c,d){
         return c*(t/=d)*t*t*t + b;
    },
    easeOutQuart: function(t,b,c,d){
        return -c * ((t=t/d-1)*t*t*t - 1) + b;
    },
    easeInOutQuart: function(t,b,c,d){
        if ((t/=d/2) < 1) return c/2*t*t*t*t + b;
        return -c/2 * ((t-=2)*t*t*t - 2) + b;
    },
    easeInQuint: function(t,b,c,d){
        return c*(t/=d)*t*t*t*t + b;
    },
    easeOutQuint: function(t,b,c,d){
        return c*((t=t/d-1)*t*t*t*t + 1) + b;
    },
    easeInOutQuint: function(t,b,c,d){
        if ((t/=d/2) < 1) return c/2*t*t*t*t*t + b;
         return c/2*((t-=2)*t*t*t*t + 2) + b;
    },
    easeInSine: function(t,b,c,d){
        return -c * Math.cos(t/d * (Math.PI/2)) + c + b;
    },
    easeOutSine: function(t,b,c,d){
        return c * Math.sin(t/d * (Math.PI/2)) + b;
    },
    easeInOutSine: function(t,b,c,d){
        return -c/2 * (Math.cos(Math.PI*t/d) - 1) + b;
    },
    easeInExpo: function(t,b,c,d){
        return (t==0) ? b : c * Math.pow(2, 10 * (t/d - 1)) + b;
    },
    easeOutExpo: function(t,b,c,d){
        return (t==d) ? b+c : c * (-Math.pow(2, -10 * t/d) + 1) + b;
    },
    easeInOutExpo: function(t,b,c,d){
        if (t==0) return b;
        if (t==d) return b+c;
        if ((t/=d/2) < 1) return c/2 * Math.pow(2, 10 * (t - 1)) + b;
        return c/2 * (-Math.pow(2, -10 * --t) + 2) + b;
    },
    easeInCirc: function(t,b,c,d){
        return -c * (Math.sqrt(1 - (t/=d)*t) - 1) + b;
    },
    easeOutCirc: function(t,b,c,d){
        return c * Math.sqrt(1 - (t=t/d-1)*t) + b;
    },
    easeInOutCirc: function(t,b,c,d){
        if ((t/=d/2) < 1) return -c/2 * (Math.sqrt(1 - t*t) - 1) + b;
        return c/2 * (Math.sqrt(1 - (t-=2)*t) + 1) + b;
    },
    easeInBounce:function(t,b,c,d){
        return c - Tween.easeOutBounce(d-t, 0, c, d) + b;
    },
    easeOutBounce:function(t,b,c,d){
        if ((t/=d) < (1/2.75)) {
            return c*(7.5625*t*t) + b;
        } else if (t < (2/2.75)) {
            return c*(7.5625*(t-=(1.5/2.75))*t + .75) + b;
        } else if (t < (2.5/2.75)) {
            return c*(7.5625*(t-=(2.25/2.75))*t + .9375) + b;
        } else {
            return c*(7.5625*(t-=(2.625/2.75))*t + .984375) + b;
        }
    },
    easeInOutBounce:function(t,b,c,d){
        if (t < d/2) return Tween.easeInBounce(t*2, 0, c, d) * .5 + b;
        else return Tween.easeOutBounce(t*2-d, 0, c, d) * .5 + c*.5 + b;
    }
};

export default Tween;

import Timeline from './timeline';
import Events from '../utiliy/events';
import Core from '../utiliy/core';

var Motion = function (configs, events) {
    this.Timelines = [];
    this.LastFrame = 0;
    this._AnimationID;
    this.CurrentFrame = 0;
    this.Repeat = 1;
    this.Events = new Events();
    this.Events.binds(events);
    this.add(configs);
};
Motion.prototype = {
    add: function (configs, ifAppend) {
        var _configs = Core.isArray(configs) ? configs : [configs],
            lastFrame = 0,
            zeroFrame = ifAppend ? this.LastFrame : 0;
        for (var i = 0, l = _configs.length; i < l; i++) {
            var timeline = new Timeline(_configs[i], zeroFrame);
            this.Timelines.push(timeline);
            lastFrame = Math.max(lastFrame, timeline.LastFrame);
        }

        this.LastFrame = Math.max(this.LastFrame, lastFrame);
        return this;
    },
    append: function (configs) {
        this.add(configs, true);
        return this;
    },
    bind: function (key, func) {
        this.Events.bind(key, func);
        return this;
    },
    run: function (startFrame, endFrame, resetStart) {
        if (this._AnimationID) {
            return this;
        }

        var start = Core.int(startFrame, this.CurrentFrame),
            end = Core.int(endFrame, this.LastFrame),
            resetStart = !!resetStart ? (start <= end ? 0 : this.LastFrame) : start,
            i = start,
            stepLength,
            ifGo,
            me = this;

        if (start <= end) {
            stepLength = 1;
            ifGo = function () { return i <= end; };
        } else {
            stepLength = -1;
            ifGo = function () { return i >= end; };
        }

        var _run = function () {
            me.Events.emit('start');
            if (ifGo()) {
                me.render(i);
                me._AnimationID = requestAnimationFrame(_run);
                i += stepLength;
            } else {
                me.Repeat--;
                if (me.Repeat <= 0) {
                    me._AnimationID = null;
                    me.Events.emit('end');
                    me.Repeat = 1;
                } else {
                    i = resetStart;
                    me.render(i);
                    me._AnimationID = requestAnimationFrame(_run);
                }
            }
        }

        this._complie();

        _run();
        return this;
    },
    _complie: function () {
        Core.each(this.Timelines, 'complie');
    },
    state: function (i, isFromZeroToEnd) {
        if (0 <= i && i <= this.LastFrame) {
            isFromZeroToEnd = isFromZeroToEnd === undefined ? true : !!isFromZeroToEnd;
            this._complie();
            Core.each(this.Timelines, 'state', [i, isFromZeroToEnd]);
            this.CurrentFrame = i;
        }
    },
    render: function (i) {
        this.Events.emit('beforeEach', [i]);
        Core.each(this.Timelines, 'render', [i]);
        this.Events.emit('each', [i]);
        this.Events.emit(i);
        this.CurrentFrame = i;
    },
    reverse: function () {
        this.run(this.CurrentFrame > 0 ? this.CurrentFrame : this.LastFrame, 0);
        return this;
    },
    repeat: function (repeat) {
        this.Repeat = repeat;
        this.play();
    },
    play: function () {
        this.run();
        return this;
    },
    stop: function () {
        cancelAnimationFrame(this._AnimationID);
        this._AnimationID = null;
        this.CurrentFrame = 0;
        this.Events.emit('stop');
        return this;
    },
    pause: function () {
        cancelAnimationFrame(this._AnimationID);
        this._AnimationID = null;
        this.Events.emit('pause');
        return this;
    },
    isPlaying: function() {
        return !!this._AnimationID;
    }
};

export default Motion;

import Motion from '../core/index';
import Core from '../utiliy/core';

var Speed = function(config, events, x) {
    this._Config = Core.isArray(config) ? config : [config];
    this._Events = events;
    this._isFromeZero = true;
    this.Mframes = {
        '1': new Motion(config, events)
    };
    this.CurrentSpeed = 1;
    this.x(x);
};

Speed.prototype = {
    x: function(x) {
        if (Core.isArray(x) && x.length > 0) {
            this.xspeed(x);
        } else if(x) {
            this.xconfig(x);
        }
    },
    _xspeed: function(speed) {
        var _config = this._Config,
            events = this._u_event(this._Events, speed),
            config=[];
        for (var i = 0, l = _config.length; i < l; i++) {
            config.push(this._u_config(_config[i], speed));
        }
        return new Motion(config, events);
    },
    /*
    0.5 1 2
    */
    xspeed: function(x) {
        for (var i = 0, l = x.length; i < l; i++) {
            var speed = x[i];
            if (typeof speed === 'number' && speed!==1) {
                this.Mframes[speed] = this._xspeed(speed);
            }
        }
    },
    /*
    {
        1: {},
        2: {},
        1.5: true
    }
    */
    xconfig: function(config) {
        var speed,
            val;
        for (var name in config) {
            speed = parseFloat(name);
            if (speed.toString!=='NaN' && speed!==1) {
                val = config[name];
                if (val === true) {
                    this.Mframes[speed] = this._xspeed(speed);
                } else {
                    this.Mframes[speed] = new Motion(val, this._u_event(this._Events, speed));
                }
            }
        }
    },
    _u_time: function(key, base, speed) {
        return Math.ceil(key*speed/base);
    },
    _u_config: function(config, speed) {
        var ret = {},
            item;
        for (var name in config) {
            item = config[name];
            if (name === 'frames') {
                var _f = [],
                    _item;
                for (var i = 0, l = item.length; i < l; i++) {
                    _item = Object.assign({}, item[i]);
                    _item.time = this._u_time(_item.time, 1, speed);
                    _f.push(_item);
                }
                ret.frames = _f;
            } else if (name === 'events') {
                ret.events = this._u_event(item, speed);
            } else {
                ret[name] = item;
            }
        }
        return ret;
    },
    _u_event: function(event, speed) {
        if (event) {
            var ret={};
            for (var key in event) {
                if (Core.isInt(key)) {
                    var n = this._u_time(parseInt(key),1,speed);
                    ret[n] = event[key];
                } else {
                    ret[key] = event[key];
                }
            }
            return ret;
        } else {
            return event;
        }
    },
    current: function(val) {
        if(typeof val === 'number') {
            this.CurrentSpeed = val;
        } else {
            return this.CurrentSpeed;
        }
    },
    currentMframe: function() {
        return this.Mframes[this.CurrentSpeed];
    },
    speed: function(x) {
        if(typeof x === 'number' && x!=this.current()) {
            if (this.Mframes[x] === undefined) {
                this.xspeed([x]);
            }
            var _pre = this.currentMframe(),
                _preFrame = _pre.CurrentFrame,
                _mframe = this.Mframes[x],
                _currentFrame = this._u_time(_preFrame, this.current(), x),
                _isPlaying = _pre.isPlaying();
            _pre.pause();
            _mframe.state(_currentFrame, this._isFromeZero);
            _mframe.Repeat = _pre.Repeat;
            if(_isPlaying) {
                _mframe.run(undefined, undefined, true);
            }
            this.current(x);
        }
    },
    play: function() {
        var m = this.currentMframe();
        m.play.apply(m, arguments);
    },
    stop: function() {
        var m = this.currentMframe();
        m.stop.apply(m, arguments);
    },
    pause: function()  {
        var m = this.currentMframe();
        m.pause.apply(m, arguments);
    },
    repeat: function() {
        var m = this.currentMframe();
        m.repeat.apply(m, arguments);
    },
    reverse: function()  {
        var m = this.currentMframe();
        m.reverse.apply(m, arguments);
    },
    run: function()  {
        var m = this.currentMframe();
        m.run.apply(m, arguments);
    },
    state: function()  {
        var m = this.currentMframe();
        m.state.apply(m, arguments);
    }
}

export default Speed;

const RegInt = /^(-?[1-9]\d*)|0$/;

var Core = {
  guid: function () {
    return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
      var r = Math.random() * 16 | 0;
      var v = c === 'x' ? r : (r & 0x3 | 0x8);
      return v.toString(16);
    });
  },
  access: function (elem, key, value, fn) {
    var length = elem.length;
    // fake bool
    if (typeof length === 'number') {
      for (var i = 0; i < length; i++) {
        fn(elem[i], key, value);
      }
    } else {
      fn(elem, key, value);
    }
  },
  each: function (elem, funcName, args) {
    var length = elem.length;
    // fake bool
    if (typeof length === 'number') {
      for (var i = 0; i < length; i++) {
        elem[i][funcName].apply(elem[i], args);
      }
    } else {
      elem[funcName].apply(elem, args);
    }
  },
  toArray: function (obj) {
    return Array.prototype.slice.call(obj);
  },
  isArray: function (obj) {
    return Object.prototype.toString.call(obj) === '[object Array]';
  },
  int: function (num, def) {
    var d = def || 0,
      n;
    if (typeof num === 'number') {
      n = num >> 0;
      return n >= 0 ? n : d;
    }
    return d;
  },
  isInt: function(v) {
    return RegInt.test(v);
  }
};

export default Core;

import Core from '../utiliy/core';
import Browser from '../utiliy/browser';

var Help = {
    support: {},
    regMsPrefix: /^-ms-/,
    regDashAlpha: /-([\da-z])/gi,
    cssProps: {},
    camelCase: function (string) {
        return string.replace(this.regMsPrefix, "ms-").replace(this.regDashAlpha, this.fcamelCase);
    },
    fcamelCase: function (all, letter) {
        return letter.toUpperCase();
    },
    upper1st: function (name) {
        return name.charAt(0).toUpperCase() + name.slice(1);
    },
    // return a css property mapped to a potentially vendor prefixed property
    vendorPropName: function (style, name) {
        // shortcut for names that are not vendor prefixed
        if (name in style) {
            return name;
        }
        // check for vendor prefixed names
        var capName = this.upper1st(name),
            origName = name;

        name = Browser.CssPrefixes + capName;
        if (name in style) {
            return name;
        }

        return origName;
    },
    test: function () {
        var div, a, style;
        div = document.createElement("div");
        div.innerHTML = "  <link/><table></table><a href='/a'>a</a><input type='checkbox'/>";
        a = div.getElementsByTagName("a")[0];
        style = a && a.style;
        if (!style) {
            return;
        }
        style.cssText = "float:left;opacity:.5";
        // Verify style float existence
        // (IE uses styleFloat instead of cssFloat)
        this.support.cssFloat = !!style.cssFloat;
        this.support.clearCloneStyle = div.style.backgroundClip === "content-box";
        this.cssProps.float = this.support.cssFloat ? "cssFloat" : "styleFloat";
        this.getComputedStyle = typeof window.getComputedStyle === 'function' ?
            window.getComputedStyle :
            document.defaultView.getComputedStyle;
    },
    getPropName: function (style, origName) {
        return this.cssProps[origName] || (this.cssProps[origName] = this.vendorPropName(style, origName));
    },
    css: function (dom, key, value) {
        //only deal with dom
        if (!dom || dom.nodeType === 3 || dom.nodeType === 8 || !dom.style) {
            return;
        }

        var origName = this.camelCase(key),
            style = dom.style,
            name = this.getPropName(style, origName);

        if (value !== undefined) {
            //return when null and NaN
            if (value == null || value !== value) {
                return;
            }

            try {
                style[name] = value;
            } catch (e) { }

        } else {
            var v = style[name],
                ret;
            if (v === undefined || v === '') {
                try {
                    ret = document.defaultView.getComputedStyle(dom)[name];
                } catch (e) {
                    return '';
                }
                return ret;
            } else {
                return style[name];
            }
        }
    }
};

Help.test();


var css = {
    _set: function (dom, key, val) {
        Help.css(dom, key, val);
    },
    set: function (dom, key, val) {
        Core.access(dom, key, val, this._set);
    },
    _get: function (dom, key) {
        return Help.css(dom, key);
    },
    get: function (dom, key) {
        return this._get(typeof dom.length === 'number' ? dom[0] : dom, key);
    }
}
export default css;

import Core from '../utiliy/core';

var attr = {
    _set: function (dom, key, val) {
        dom.setAttribute(key, val);
    },
    set: function (dom, key, val) {
        Core.access(dom, key, val, this._set);
    },
    _get: function (dom, key) {
        return dom.getAttribute(key);
    },
    get: function (dom, key) {
        return this._get(typeof dom.length === 'number' ? dom[0] : dom, key);
    }
}

export default attr;

import Core from '../utiliy/core';
var prop = {
    _set: function (dom, key, val) {
        dom[key] = val;
    },
    set: function (dom, key, val) {
        Core.access(dom, key, val, this._set);
    },
    _get: function (dom, key) {
        return dom[key];
    },
    get: function (dom, key) {
        return this._get(typeof dom.length === 'number' ? dom[0] : dom, key);
    }
}

export default prop;

var func = {
    set: function (dom, key, val) {
        return '';
    },
    get: function (dom, key) {
        return '';
    }
}

export default func;

import core from './core';

var Events = function () {
  this.Events = {};
};
Events.prototype = {
  RegInt: /^[1-9]\d*$/,
  bind: function (key, func) {
    if (func._$EventGuid === undefined) {
      func._$EventGuid = core.guid();
    }
    if (this.Events[key] === undefined) {
      this.Events[key] = {};
    }
    this.Events[key][func._$EventGuid] = func;
    return func._$EventGuid;
  },
  binds: function (json, base) {
    if (json) {
      var newKey,
        hasBase = typeof base === 'number';
      for (var key in json) {
        newKey = hasBase && this.RegInt.test(key) ? base + key : key;
        this.bind(newKey, json[key]);
      }
    }
  },
  emit: function (key, args, caller) {
    var events = this.Events[key];
    if (events) {
      for (var funcGuid in events) {
        events[funcGuid].apply(caller, args);
      }
    }
  },
  // emit with one arg
  fire: function (key, args, caller) {
    var events = this.Events[key];
    if (events) {
      for (var funcGuid in events) {
        events[funcGuid].call(caller, args);
      }
    }
  },
  unbind: function (key, funcOrGuid) {
    if (this.Events[key]) {
      var guid = typeof funcOrGuid === 'string' ? funcOrGuid : funcOrGuid._$EventGuid;
      delete this.Events[key][guid];
    }
  }
};

export default Events;

import KeyFrames from './keyFrames';
import Events from'../utiliy/events';
import Cpu from '../cpu/index';

var Timeline = function(config, zeroFrame) {
    this.Dom = config.dom;
    this.Frames = config.frames;
    this.Storage = Cpu.createStorage();
    this.Events = new Events();
    this.Events.binds(config.events);
    this.ZeroFrame = zeroFrame || 0;
    this._scan();
};
Timeline.prototype = {
    _store: function(coreName, props, time, tween) {
        if (props === undefined) {
            return;
        }
        var storage = this.Storage[coreName],
            dom = this.Dom;
        for (var propName in props) {
            if (storage[propName] === undefined) {
                storage[propName] = new KeyFrames(dom, coreName, propName);
            }
            storage[propName].add(props[propName], time, tween);
        }
    },
    _scan: function() {
        var frames = this.Frames,
            storage = this.Storage,
            frame,
            tween,
            time,
            last = 0;
        for (var i = 0, l = frames.length; i < l; i++) {
            frame = frames[i];
            time = frame.time || 0;
            tween = frame.tween || 'linear';
            for (var coreName in storage) {
                this._store(coreName, frame[coreName], time, tween);
            }
            last = Math.max(time, last);
        }
        this.LastFrame = last;
        this._excuteStorage('preComplie');
    },
    getArgs: function(index) {
        var storage = this.Storage.arg,
            ret = {},
            val;
        for(var propName in storage) {
            val = storage[propName].Frames[index];
            if(val!== undefined) {
                ret[propName] = val;
            }
        }
        return ret;
    },
    state: function (i, isFromZeroToEnd) {
        let index;
        if(i< this.ZeroFrame) {
            if (!isFromZeroToEnd) {
                index = this.zeroFrame;
            }
        } else if (i>this.LastFrame) {
            if (isFromZeroToEnd) {
                index = this.LastFrame;
            }
        } else {
            index = i- this.ZeroFrame;
        }
